const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`The Vector `}<inlineCode parentName="p">{`vector`}</inlineCode>{` sink
`}<a parentName="p" {...{
        "href": "#streaming"
      }}>{`streams`}</a>{` `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode></a>{` and
`}<a parentName="p" {...{
        "href": "/docs/about/data-model/metric/"
      }}><inlineCode parentName="a">{`metric`}</inlineCode></a>{` events to another downstream `}<a parentName="p" {...{
        "href": "/docs/reference/sources/vector/"
      }}><inlineCode parentName="a">{`vector`}</inlineCode>{`
source`}</a>{`.`}</p>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/reference/sinks/vector.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <Tabs block={true} defaultValue="common" values={[{
      "label": "Common",
      "value": "common"
    }, {
      "label": "Advanced",
      "value": "advanced"
    }]} mdxType="Tabs">
      <TabItem value="common" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[sinks.my_sink_id]
  type = "vector" # required
  inputs = ["my-source-or-transform-id"] # required
  address = "92.12.333.224:5000" # required
  healthcheck = true # optional, default
`}</code></pre>
      </TabItem>
      <TabItem value="advanced" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[sinks.my_sink_id]
  # General
  type = "vector" # required
  inputs = ["my-source-or-transform-id"] # required
  address = "92.12.333.224:5000" # required
  healthcheck = true # optional, default

  # Buffer
  buffer.max_events = 500 # optional, default, events, relevant when type = "memory"
  buffer.max_size = 104900000 # required, bytes, required when type = "disk"
  buffer.type = "memory" # optional, default
  buffer.when_full = "block" # optional, default

  # TLS
  tls.ca_file = "/path/to/certificate_authority.crt" # optional, no default
  tls.crt_file = "/path/to/host_certificate.crt" # optional, no default
  tls.enabled = false # optional, default
  tls.key_file = "/path/to/host_certificate.key" # optional, no default
  tls.key_pass = "\${KEY_PASS_ENV_VAR}" # optional, no default
  tls.verify_certificate = true # optional, default
  tls.verify_hostname = true # optional, default
`}</code></pre>
      </TabItem>
    </Tabs>
    <Fields filters={true} mdxType="Fields">
      <Field common={true} defaultValue={null} enumValues={null} examples={["92.12.333.224:5000"]} groups={[]} name={"address"} path={null} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "address"
        }}>{`address`}</h3>
        <p>{`The downstream Vector address to connect to. The address `}<em parentName="p">{`must`}</em>{` include a port.`}</p>
      </Field>
      <Field common={false} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"buffer"} path={null} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "buffer"
        }}>{`buffer`}</h3>
        <p>{`Configures the sink specific buffer behavior.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={500} enumValues={null} examples={[500]} groups={[]} name={"max_events"} path={"buffer"} relevantWhen={{
            "type": "memory"
          }} required={false} templateable={false} type={"uint"} unit={"events"} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "max_events"
            }}>{`max_events`}</h4>
            <p>{`The maximum number of `}<a parentName="p" {...{
                "href": "/docs/about/data-model/"
              }}>{`events`}</a>{` allowed in the buffer.`}</p>
          </Field>
          <Field common={false} defaultValue={null} enumValues={null} examples={[104900000]} groups={[]} name={"max_size"} path={"buffer"} relevantWhen={{
            "type": "disk"
          }} required={true} templateable={false} type={"uint"} unit={"bytes"} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "max_size"
            }}>{`max_size`}</h4>
            <p>{`The maximum size of the buffer on the disk.`}</p>
          </Field>
          <Field common={true} defaultValue={"memory"} enumValues={{
            "memory": "Stores the sink's buffer in memory. This is more performant, but less durable. Data will be lost if Vector is restarted forcefully.",
            "disk": "Stores the sink's buffer on disk. This is less performant, but durable. Data will not be lost between restarts."
          }} examples={["memory", "disk"]} groups={[]} name={"type"} path={"buffer"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "type"
            }}>{`type`}</h4>
            <p>{`The buffer's type and storage mechanism.`}</p>
          </Field>
          <Field common={false} defaultValue={"block"} enumValues={{
            "block": "Applies back pressure when the buffer is full. This prevents data loss, but will cause data to pile up on the edge.",
            "drop_newest": "Drops new data as it's received. This data is lost. This should be used when performance is the highest priority."
          }} examples={["block", "drop_newest"]} groups={[]} name={"when_full"} path={"buffer"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "when_full"
            }}>{`when_full`}</h4>
            <p>{`The behavior when the buffer becomes full.`}</p>
          </Field>
        </Fields>
      </Field>
      <Field common={true} defaultValue={true} enumValues={null} examples={[true, false]} groups={[]} name={"healthcheck"} path={null} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "healthcheck"
        }}>{`healthcheck`}</h3>
        <p>{`Enables/disables the sink healthcheck upon start.
See `}<a parentName="p" {...{
            "href": "#health-checks"
          }}>{`Health Checks`}</a>{` for more info.`}</p>
      </Field>
      <Field common={false} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"tls"} path={null} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "tls"
        }}>{`tls`}</h3>
        <p>{`Configures the TLS options for connections from this sink.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={false} defaultValue={null} enumValues={null} examples={["/path/to/certificate_authority.crt"]} groups={[]} name={"ca_file"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "ca_file"
            }}>{`ca_file`}</h4>
            <p>{`Absolute path to an additional CA certificate file, in DER or PEM format
(X.509), or an inline CA certificate in PEM format.`}</p>
          </Field>
          <Field common={true} defaultValue={null} enumValues={null} examples={["/path/to/host_certificate.crt"]} groups={[]} name={"crt_file"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "crt_file"
            }}>{`crt_file`}</h4>
            <p>{`Absolute path to a certificate file used to identify this connection, in DER or
PEM format (X.509) or PKCS#12, or an inline certificate in PEM format. If this
is set and is not a PKCS#12 archive, `}<a parentName="p" {...{
                "href": "#key_file"
              }}><inlineCode parentName="a">{`key_file`}</inlineCode></a>{` must also be set.`}</p>
          </Field>
          <Field common={true} defaultValue={false} enumValues={null} examples={[false, true]} groups={[]} name={"enabled"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "enabled"
            }}>{`enabled`}</h4>
            <p>{`Enable TLS during connections to the remote.`}</p>
          </Field>
          <Field common={true} defaultValue={null} enumValues={null} examples={["/path/to/host_certificate.key"]} groups={[]} name={"key_file"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "key_file"
            }}>{`key_file`}</h4>
            <p>{`Absolute path to a private key file used to identify this connection, in DER or
PEM format (PKCS#8), or an inline private key in PEM format. If this is set,
`}<inlineCode parentName="p">{`crt_file`}</inlineCode>{` must also be set.`}</p>
          </Field>
          <Field common={false} defaultValue={null} enumValues={null} examples={["${KEY_PASS_ENV_VAR}", "PassWord1"]} groups={[]} name={"key_pass"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "key_pass"
            }}>{`key_pass`}</h4>
            <p>{`Pass phrase used to unlock the encrypted key file. This has no effect unless
`}<inlineCode parentName="p">{`key_file`}</inlineCode>{` is set.`}</p>
          </Field>
          <Field common={false} defaultValue={true} enumValues={null} examples={[true, false]} groups={[]} name={"verify_certificate"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[{
            "visibility_level": "option",
            "text": "Setting this to `false` means the certificate will be loaded and checked for validity, but the handshake will not attempt to verify the certificate. Do NOT set this to `false` unless you understand the risks of not verifying the remote certificate.",
            "option_name": "verify_certificate"
          }]} mdxType="Field">
            <h4 {...{
              "id": "verify_certificate"
            }}>{`verify_certificate`}</h4>
            <p>{`If `}<inlineCode parentName="p">{`true`}</inlineCode>{` (the default), Vector will validate the TLS certificate of the remote
host.`}</p>
          </Field>
          <Field common={false} defaultValue={true} enumValues={null} examples={[true, false]} groups={[]} name={"verify_hostname"} path={"tls"} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "verify_hostname"
            }}>{`verify_hostname`}</h4>
            <p>{`If `}<inlineCode parentName="p">{`true`}</inlineCode>{` (the default), Vector will validate the configured remote host name
against the remote host's TLS certificate. Do NOT set this to `}<inlineCode parentName="p">{`false`}</inlineCode>{` unless
you understand the risks of not verifying the remote hostname.`}</p>
          </Field>
        </Fields>
      </Field>
    </Fields>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "buffers"
    }}>{`Buffers`}</h3>
    <SVG src="/img/buffers.svg" mdxType="SVG" />
    <p>{`The `}<inlineCode parentName="p">{`vector`}</inlineCode>{` sink buffers events as shown in
the diagram above. This helps to smooth out data processing if the downstream
service applies backpressure. Buffers are controlled via the
`}<a parentName="p" {...{
        "href": "#buffer"
      }}><inlineCode parentName="a">{`buffer.*`}</inlineCode></a>{` options.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "health-checks"
    }}>{`Health Checks`}</h3>
    <p>{`Health checks ensure that the downstream service is accessible and ready to
accept data. This check is performed upon sink initialization.
If the health check fails an error will be logged and Vector will proceed to
start.`}</p>
    <h4 {...{
      "id": "require-health-checks"
    }}>{`Require Health Checks`}</h4>
    <p>{`If you'd like to exit immediately upon a health check failure, you can
pass the `}<inlineCode parentName="p">{`--require-healthy`}</inlineCode>{` flag:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`vector --config /etc/vector/vector.toml --require-healthy
`}</code></pre>
    <h4 {...{
      "id": "disable-health-checks"
    }}>{`Disable Health Checks`}</h4>
    <p>{`If you'd like to disable health checks for this sink you can set the
`}<inlineCode parentName="p">{`healthcheck`}</inlineCode>{` option to `}<inlineCode parentName="p">{`false`}</inlineCode>{`.`}</p>
    <h3 {...{
      "id": "streaming"
    }}>{`Streaming`}</h3>
    <p>{`The `}<inlineCode parentName="p">{`vector`}</inlineCode>{` sink streams data on a real-time
event-by-event basis. It does not batch data.`}</p>
    <h3 {...{
      "id": "tls-1"
    }}>{`TLS`}</h3>
    <p>{`Vector uses `}<a parentName="p" {...{
        "href": "https://www.openssl.org/"
      }}>{`Openssl`}</a>{` for TLS protocols for it's battle-tested
and reliable security. You can enable and adjust TLS behavior via the `}<a parentName="p" {...{
        "href": "#tls"
      }}><inlineCode parentName="a">{`tls.*`}</inlineCode></a>{`
options.`}</p>
    </MDXLayout>;
}

